import React from 'react';

const Card = (props) => {
  let dataSection;
  switch(props.type) {
    case "list":
      dataSection = <React.Fragment>
        <ul>
          {props.data.map((obj) => (
            <li>{obj.value}</li>
          ))}
        </ul>
      </React.Fragment>;
      break;
    case "dollar":
      dataSection = <React.Fragment>
        ${props.data}
      </React.Fragment>;
      break;
    case "stat":
      dataSection = <React.Fragment>
        {props.data}
      </React.Fragment>;
      break;
    default:
      return("");
  }

  return (
    <div className="card">
      <h1>{props.title}</h1>
      <h3>{this.dataSection}</h3>
    </div>
  );

}

export default Card;
